import {NgModule} from '@angular/core';
import { CommonModule } from '@angular/common';

import { MainPageComponent } from '../Pages/main-page.component';

@NgModule({
  declarations:[
    MainPageComponent
  ],
  exports:[
    MainPageComponent
  ],

  imports:[
    CommonModule
  ]
})
export class MedicinaInmersiva{}
